Accounts_CustomFields_Description:
キーはフィールド設定の辞書を含むフィールド名となっている、有効なJSONでなければなりません。例: <br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
キーが言語で値に翻訳の辞書を含む有効なJSONである必要があります。例: <br/><code>{
 "en": {
  "Channels": "Rooms"
 },
 "ja": {
  "Channels": "部屋"
 }
}</code>

SAML_Custom_user_data_fieldmap_descripti:
ユーザーアカウントのフィールド（電子メールなど）をSAMLのレコードから検索する方法を構成します（見つかったら）。例として、 `{"name":"cn", "email":"mail"}` は人の判読可能な名前をcn属性から選択し、メールをmail属性から選択します。 
Rocket.Chatで利用可能なフィールド： `name`、` email`、 `username`、その他はすべて` customFields`として保存されます。
不変属性の名前を '__identifier__'キーに割り当てて、ユーザー識別子として使用します。
正規表現とテンプレートを使用することもできます。テンプレートは、正規表現の結果を参照する場合を除いて、最初に処理されます。
```{
  "email": "mail",
  "username": {
    "fieldName": "mail",
    "regex": "(.*)@.+$",
    "template": "user-__regex__"
  },
  "name": {
   "fieldNames": [
      "firstName",
      "lastName"
    ],
    "template": "__firstName__ __lastName__"
  },
  "__identifier__": "uid"
}```
